import React from "react";

const Sellcar = () => {
  return (
    <div>
      <div className="auth">
        <div className="form">
          <form onSubmit={handleSubmit}>
            <h1>Login</h1>
            <div className="mb-3">
              <input
                className="form-control"
                name="username"
                type="text"
                placeholder="Enter username"
              />
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Sellcar;
